  function arrayBufferToBase64(buffer2) {
    var binary = "";
    var bytes = new Uint8Array(buffer2);
    var len = bytes.byteLength;
    for (var i = 0; i < len; i++) {
      binary += String.fromCharCode(bytes[i]);
    }
    return btoa(binary);
  }

